import axios from 'axios'
import React, { useEffect, useState } from 'react'
import { Link, Outlet } from 'react-router-dom'

const HomeJ = () => {
  const[myrecipe,setmyrecipe]=useState([])
  useEffect(function(){
    axios.get('http://localhost:1234/Recipes/getAll').then(l=>{setmyrecipe(l.data)})
  },[])
  return  <div className='row text-center'>
      {myrecipe?.map(n=><div  ><div className='col-sm-3'><p  key={n.id}><Link to={`mymoredetails/${n._id}`}><div ><div className='btn btn-default' style={{width:230}}>{n.name}</div>   
      <img class="img-responsive" src={n.pic} width="230" height="180"></img></div></Link><br></br></p></div></div>)}
      <Outlet ></Outlet>
      </div>
}

export default HomeJ
